function out = vd_Comb4Moments(in)
out = [in(46) in(47) in(48) in(37) in(38) in(39) in(43) in(44) in(45) in(40) in(41) in(42) ...
   in(34) in(35) in(36) in(25) in(26) in(27) in(31) in(32) in(33) in(28) in(29) in(30) ...
